$(document).ready(function(){
   let button = $('#button');
   let modal = $('#modal');
   let mClose = $('#mClose');

   button.on('click', function(){
      modal.addClass('modal_active');
   });

   mClose.on('click', function(){
      modal.removeClass('modal_active');
      });

   $('.slider').slick({
      speed: 600,
      slidesToShow: 3,
      slidesToScroll: 1,
      prevArrow: $('.arrows__left'),
      nextArrow: $('.arrows__right'),
      responsive: [{
            breakpoint: 1200,
            settings: {
               slidesToShow: 2,
               slidesToScroll: 1
            }
         },
         {
            breakpoint: 770,
            settings: {
               slidesToShow: 1,
               slidesToScroll: 1
            }
         }
      ]
   });
});

